function WagonBtn(isFocused, handleWagonClick, wagon_number) {
    return (
        <div className="btn_wagon">
            {isFocused ? (
                <button className="btn_wagon_focused" key={index} onClick={() => handleWagonClick(index)}>
                    {wagon_number + 1}
                </button>
            ) : (
                <button className="btn_wagon" key={index} onClick={() => handleWagonClick(index)}>
                    {wagon_number + 1}
                </button>
            )}
        </div>
    );
}

export default WagonBtn;
